// Registry of registered securities
// (c) Kallol Borah, 2021

pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

import "../interfaces/ISecuritiesRegistry.sol";
import "../interfaces/IPoolFactory.sol";
import "../interfaces/ViaFactory.sol";
import "../interfaces/VerifiedClient.sol";
import "../interfaces/VerifiedIssues.sol";
import "../utilities/StringUtils.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/upgrades/contracts/upgradeability/ProxyFactory.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/IERC20.sol";

contract SecuritiesRegistry is Initializable, Ownable, ProxyFactory, ISecuritiesRegistry{

    using ABDKMathQuad for bytes16;
    using stringutils for *;

    ViaFactory private via;

    address poolFactory;
    address preTradeContract;
    address tradeContract;
    address postTradeContract;
    address clientContract;

    mapping(address => security) private securityTokens;

    address[] private tokens;

    mapping(address => mapping(bytes32 => string[])) private corporateActions;
    
    //event signalling creation of a security token
    event SecurityCreated(address indexed security, bytes32 company, bytes32 isin);
    //event signalling corporate action
    event CorporateAction(address indexed security, bytes32 company, bytes32 isin, bytes32 category, string action);

    function initialize(address _viaFactory, address _poolFactory, address _preTradeContract, address _tradeContract, address _postTradeContract, address _clientContract) public initializer{
        Ownable.initialize(msg.sender);
        via = ViaFactory(_viaFactory);
        poolFactory = _poolFactory;
        preTradeContract = _preTradeContract;
        tradeContract = _tradeContract;
        postTradeContract = _postTradeContract;
        clientContract = _clientContract;
    }

    function createSecurity(address _issuer, address _security, bytes32 _currency, bytes32 _company, bytes32 _isin, bytes32 _settlementBy) external {
        require(msg.sender==preTradeContract || VerifiedIssues(msg.sender).getOwner()==owner());
        address cash = via.getTokenByNameType(_currency, "ViaCash");
        require(cash!=address(0x0));
        
        if(!isRegistered(_company, _currency, _isin)){
            bytes memory _payload = abi.encodeWithSignature("initialize(bytes32,bytes32,address,address,address,address)", _company, _isin, preTradeContract, tradeContract, postTradeContract, clientContract);

            address _token = deployMinimal(_security, _payload);
            emit SecurityCreated(_token, _company, _isin);

            securityTokens[_token] = security(_company, _currency, _isin, "none", ABDKMathQuad.fromUInt(0), _issuer);
            tokens.push(_token);

            IPoolFactory(poolFactory).createPool(_token, cash, _currency, _settlementBy);
        }
    }

    function isRegistered(bytes32 _company, bytes32 _currency, bytes32 _isin) private view returns(bool){
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].company==_company &&
                securityTokens[tokens[i]].currency==_currency &&
                securityTokens[tokens[i]].isin==_isin)
                    return true;
        }
        return false;
    }

    function getToken(bytes32 _currency, bytes32 _company, bytes32 _isin) external view returns(address){
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].currency==_currency &&
                securityTokens[tokens[i]].company==_company &&
                securityTokens[tokens[i]].isin==_isin){
                    return tokens[i];
            }
        }
    }

    function getSecuritiesIssued() external view returns(address[] memory){
        return tokens;
    }

    function getSecuritiesInvested() external view returns(address[] memory){
        //require(VerifiedClient(clientContract).isRegistered(msg.sender));
        uint count = 0;
        for(uint i=0; i<tokens.length; i++){
            if(IERC20(tokens[i]).balanceOf(msg.sender)>0)
                count = count + 1;
        }
        address[] memory securities = new address[](count);
        count = 0;
        for(uint i=0; i<tokens.length; i++){
            if(IERC20(tokens[i]).balanceOf(msg.sender)>0)
                securities[count] = tokens[i]; 
        }
        return securities;
    }

    function getSecurityDetails(address _securityToken) external view returns(security memory){
        return securityTokens[_securityToken];
    }

    function isIsinPresent(bytes32 _isin) external returns(bool){
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].isin==_isin){
                    return true;
            }
        }
        return false;
    }

    function registerCorporateAction(bytes32 _category, string calldata _action, bytes32 _isin) external{
        //only company or a DP/registrar can report corporate action
        require(_isin!="" && _category!="" && stringutils.equal(_action,""));
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].isin==_isin && 
                (securityTokens[tokens[i]].issuer==msg.sender || VerifiedClient(clientContract).getRole(msg.sender)=="DP")){
                corporateActions[tokens[i]][_category].push(_action);
                emit CorporateAction(tokens[i], 
                                    securityTokens[tokens[i]].company, 
                                    securityTokens[tokens[i]].isin, 
                                    _category, _action);
            }
        }
    }

    function registerCreditScore(bytes32 _company, bytes32 _isin, bytes32 _score) external {
        //only verified admin can report credit score
        require(msg.sender == owner());
        require(_company!="" || _isin!="" && _score!="");
        for(uint i=0; i<tokens.length; i++){
            if(_company==""){
                if(securityTokens[tokens[i]].isin==_isin){
                    securityTokens[tokens[i]].creditScore = _score;
                }
            }
            else if(_isin==""){
                if(securityTokens[tokens[i]].isin!="" && securityTokens[tokens[i]].company==_company){
                    securityTokens[tokens[i]].creditScore = _score;
                }
            }
            else{
                if(securityTokens[tokens[i]].isin==_isin && securityTokens[tokens[i]].company==_company){
                    securityTokens[tokens[i]].creditScore = _score;
                }
            }
        }
    }

    function registerPrice(bytes32 _isin, bytes16 _price) external {
        //only post trade contract can report price
        require(msg.sender==postTradeContract);
        require(_isin!="" && ABDKMathQuad.cmp(_price, ABDKMathQuad.fromUInt(0))>0);
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].isin==_isin){
                securityTokens[tokens[i]].price = _price;
            }
        }
    }

    function getCorporateActions(bytes32 _isin, bytes32 _category) external view returns(string[] memory){
        require(_isin!="" && _category!="");
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].isin==_isin){
                return corporateActions[tokens[i]][_category];
            }
        }
    }

    function getCreditScore(bytes32 _isin, bytes32 _company) external view returns(bytes32){
        require(_company!="" || _isin!="");
        bool found = false;
        for(uint i=0; i<tokens.length; i++){
            if(_company=="" && !found){
                if(securityTokens[tokens[i]].isin==_isin){
                    found = true;
                    return securityTokens[tokens[i]].creditScore;
                }
            }
            else if(_isin=="" && !found){
                if(securityTokens[tokens[i]].isin!="" && securityTokens[tokens[i]].company==_company){
                    found = true;
                    return securityTokens[tokens[i]].creditScore;
                }
            }
            else if(!found){
                if(securityTokens[tokens[i]].isin==_isin && securityTokens[tokens[i]].company==_company){
                    found = true;
                    return securityTokens[tokens[i]].creditScore;
                }
            }
        }
    }

    function getPrice(bytes32 _isin) external view returns(bytes16){
        require(_isin!="");
        for(uint i=0; i<tokens.length; i++){
            if(securityTokens[tokens[i]].isin==_isin){
                return securityTokens[tokens[i]].price;
            }
        }
    }

}
